import React from 'react';

class Mathematics extends React.Component{
	constructor(props){
		super(props)
	}


	render(){
		return (
			<div>
				we've already discussed <b>+</b>, <b>-</b>, <b>*</b>, <b>/</b>, and <b>%</b> (<b className="note">psst. need a reminder</b> on what these operators mean? check out the <b className="pageName">arithmetics page</b>!). but what if we want to do more <b>complex math operations</b>, such as raising a number to a power, or getting the absolute value of a number? luckily for us, the <b>Math</b> library provides us with a variety of math constants and complex functions. let's take a look at all of the brand new and super cool functionality the <b>Math</b> library gives us (<b className="note">btw:</b> that's Math with a capital M)!
				<br/>
				<h3>i'm hungry... can i get some pi?</h3>
				<h3>eeeeeeee</h3>
				<h3>boom! pow!</h3>
				<h3>i'm (square) rooting for you</h3>
				<h3>i wish i had a six pack</h3>
			</div>
		)
	}
}

export default Mathematics;
